use Illuminate\Database\Seeder;
use App\Country;
use App\State;

class UsCountySeeder extends Seeder
{
    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        $data = $this->data();
        $countryId  = Country::where('country_code', 'USA')->first()->id;
        $states     = State::where('country_id', $countryId)->get();
        $cleanData = [];

        foreach ($data as $rawCounty) {
            $state                      = $states->where('state_code', $rawCounty['state_id'])->first();

            $countyData                 = $rawCounty;
            $countyData['county_name']  = trim($countyData['county_name']);
            $countyData['state_id']     = $state['id'];

            $cleanData[]                = $countyData;
        }

        DB::table('counties')->insert($cleanData);
    }

